import string
import random
the_n = ""
the_e = "5847329"
the_d = ""

the_n_size = len(the_n)

print('the n')
print(the_n)
for i in range(the_n_size):
    the_n = the_n[:(i * 2 + 1)] + '%d' %random.randint(0, 9) + the_n[(i * 2 + 1):]

print(the_n)

print('the e')
print(the_e)

the_e_size = len(the_e)
for i in range(the_e_size):
    the_e = the_e[:(i * 3 + 1)] + '%d%d' %(random.randint(0, 9), random.randint(0, 9)) + the_e[(i * 3 + 1):]

print(the_e)

print('the d')
print(the_d)

the_d_size = len(the_d)
for i in range(the_d_size):
    the_d = the_d[:(i * 4 + 1)] + '%d%d%d' %(random.randint(0, 9), random.randint(0, 9), random.randint(0, 9)) + the_d[(i * 4 + 1):]

print(the_d)
